import logo from './logo.svg';
import './App.css';
import './index.css';
import ReactSearchBox from 'react-search-box'



const SerachBox = (dataList) =>{
  return <ReactSearchBox
  placeholder="Search a course"
  value="Doe"
  data={dataList}
  callback={(record) => console.log(record)}
  />
}



function App() {
  data = [
    {
      key: "john",
      value: "John Doe",
    },
    {
      key: "jane",
      value: "Jane Doe",
    },
    {
      key: "mary",
      value: "Mary Phillips",
    },
    {
      key: "robert",
      value: "Robert",
    },
    {
      key: "karius",
      value: "Karius",
    },
  ];

  return (
    <div className="App">
      <button className = "loginButton">Login</button>

      <p className="helloWorld">
        Hello World
        <SerachBox/>
      </p>


    </div>


  );
}

export default App;
